サーキットで生まれ、鍛え抜かれたingsの空力テクノロジーをフィードバック。最適なダウンフォースを発生するフォルム、重量、仕上げ、耐久性、クオリティといったストリートカーに求められる課題を高レベルでクリア。フラップは15段角度調節式で、車種やコースに応じた緻密なセッティングが可能です。 <br><br>●ウイングサイズ：1500mm ●ローマウントタイプ ●ブラケット高さ：40mm ●素材：【ウイング】ドライカーボン（高耐侯性クリア塗装済） 【翼端板】ドライカーボン（5mm厚） 【ブラケット】ドライカーボン 【ステー】軽量アルミ削り出し6mm材（ブラックアルマイト処理済） ●納期：2～3週間<br><br>適合車種：【TOYOTA】 JZA80・ZZW30 【NISSAN】 Z33・R32・R34・S13・S14・S15・180SX 【HONDA】 FD2・NSX・S2000・DC5・DC2 【MITSUBISHI】 EVO5/6/7/8/9/10 【SUBARU】 GDB・GC8 【MAZDA】 SE3P・FD3S・FC3S ※Z33ロードスターへの取り付けはできません。 <br><br>汎用品 <br><br>　<br><br>ボディパーツ/ウイング<br>※送料は地域や配達場所によって変わりますが、6000円～12000円程度が目安となります。<tr><td colspan="2">
