「誰よりも速く、そして誰よりも美しく」をコンセプトとして数多くのエアロパーツを創造してきた「ings」。ingsのエアロパーツは、ストリートでの存在感と魅力を引き出しつつ、ベースカーの持つポテンシャルを更に高めることを目的としている。そしてレース活動により鍛えられたノウハウは、そのままストリートへと受け継がれる。<br><br>●素材：FRP ●納期：お問い合わせ下さい。<br><br>※装着には板金・塗装作業が別途必要となります。<br><br>対応車種：ZN6 86 全グレード<br><br>車検対応品<br><br>ボディパーツ | ウイング<br>※送料は地域や配達場所によって変わりますが、6000円～12000円程度が目安となります。<tr><td colspan="2">
